ownedComment.body:
Creates a synthetic {@link Option} with the specified {@code optionFamilyId}, {@code expirationDate}, {@code targetStrike} and {@code optionType}.
<p>
The targetStrike will be rounded to a valid strike defined by {@code SecurityFamily.strikeDistance}

Prints SABR {@code alpha} / {@code rho} / {@code volvol} as well as Call & Put {@code atmVola} for defined underlying {@code isin}, {@code expirationDate} and {@code optionType}
<p>
The calculation is done from {code startDate} to {@code expirationDate} 09:00 - 17:20:00.

Calculates the {@link ATMVolVO} for defined {@code underlying} and {@code date}
<p>
the calculation considers the Call Option and Put Option closest to the spot.

Allocation assigned to the Base / Strategy.
<p>
The total of all allocations needs to be {@code 1.0}

CashFlow value occurred at the specified time.
PortfolioValues are recorded every time a transaction occurs that influences performance. 
For the Base these are {@code CREDIT} and {@code DEBIT} and for strategies, these are {@code REBALANCE}
